import styled from "styled-components";
import { FaTimes } from "react-icons/fa";

export const sidebarcontainer = styled.aside`
 bac
`

export const closeicon = styled(FaTimes)`
    color: #fff;
`

export const icon = styled.div`
    position: absolute;
    top: 1.2rem;
    right: 1.5rem;
    background: transparent;
    font-size: 2rem;
    cursor: pointer;
    outline: none;
`
